description:
Продаж котеджа з ділянкою 8 соток у сучасному котеджному містечку "Міжріччя", поряд річка Десна, Київське море, ліс. Новий будинок у Вишгородському районі, Хотянівка, Міжріччя.

ПЛАНУВАННЯ: Одноповерховий будинок - 134 м2;
- Велика вітальня з кухнею - 46 м2;
- Вихід з вітальні на терасу - 15 м2;
- 3 спальні;
- 2 санвузли;
- Передпокій;
- Котельня.
Будинок дуже комфортний та ергономічний за плануванням. Просторі, світлі приміщення.

ГОТІВНІСТЬ: Готовність будинка - 80%;
- Фундамент монолітно-стрічковий + плити перекриття;
- Стіни (коробка будинка) з газоблоку;
- Внутрішне оздоблення - штукатурка;
- Дах з натуральної черепиці "Аляска";
- Софіти + водосток;
- Фасадне утеплення з мінеральної вати;
- Клінкерна плитка + декори;
- Паркан фасадний + периметрові огородження (автоматичні відкатні ворота).

КОМФОРТ: Земельна ділянка - 7 соток;
- Електрика заведена в будинок - 5 кВт (можливе збільшення);
- Своя свердловина - 55 м2;
- Автономна каналізація - переливний септик 6м3;
- Асфальтований під'їзд до будинка;
- Освітлення всього масиву та охорона теріторії;
- Три дитячі ігрові майданчик;
- 8 озер із пляжем загального користування;
- Паркова зона біля річки Десна;
- Вивіз сміття, прибирання та чищення доріг;
- Три продуктових магазини, по п'ятницях продуктові ярмарки.

ІНФРАСТРУКТУРА: До міста Вишгород – 5 км, супермаркети, дитячі садки, школи. Кожну годину з КМ "Міжріччя" їздить маршрутне таксі до м. Героїв Дніпра. Шкільний автобус до м. Почайна – 12 км, м. Мінська - 15 км.

Показ будинка зробимо в зручний для вас час. Телефонуйте, домовимось про зустріч.

З повагою, Юрій.

Открылся новый хостел с дизайнерским евроремонтом в Соломенском районе, Воздухофлотский пр-т, недалеко от Соломенской площади.

Отличное месторасположение, хорошая транспортная развязка.

Всё новое:
* раздельные комнаты и туалеты;
* кровати с ортопедическими матрасами;
* постельное белье;
* бытовая техника (холодильник, стиральная и сушильная машина, СВЧ-печь, чайник, фен, утюг и т.д.);

Размещение в 4-х местных уютных и просторных комнатах.
Всегда есть горячая вода!

Сутки - 150/200
Неделя - 600
Месяц - 1800

Воздухофлотский проспект, 26/1, Киев, 02000
